DAKINE CAMPUS BACKPACK

The roomy design of Campus 33L features four distinct compartments including a large main compartment with a padded laptop sleeve and room for books and binders. A handy insulated pocket keeps lunch and snacks cool, while a mix of organizer pockets keeps all your essentials easy to grab. It's available in a wide range of prints and colors to suit everyone's taste.

FEATURES

S-curved backpanel and shoulder straps;
Adjustable sternum strap;
Padded laptop sleeve;
Organizer pocket;
Fleece lined sunglass pocket;
Insulated cooler pocket;
Mesh side pockets;
Padded bottom panel;
